import React from "react";

function Lines ({group}) {

    var larges = []

    if (group === "Larges") {
        for (let i = 0; i < 7; i++) {
            larges.push(<li>{i}</li>)
            console.log(larges)
        }
    }

    return (
        <div>
            <ul>{larges}</ul>
        </div>
    )
}

export default Lines
